import React from "react";
import MuzicaPopBody from "./MuzicaPopBody.jsx";
import background from "./../../media/images/BK/Concert4.jpg";

const MuzicaPop = () => {
  return (
    <>
      <div
        style={{
          backgroundImage: `url(${background})`,
          width: "100vw",
          height: "220vh",
        }}
      >
        <h1
          className="row d-flex justify-content-center text-white"
          style={{ borderTop: "5rem" }}
        >
          Muzica Pop{" "}
        </h1>
        <MuzicaPopBody></MuzicaPopBody>
      </div>
    </>
  );
};

export default MuzicaPop;
